svg.script:
//
//TODO: Minify JS code
//TODO: Remove console.log() output
var iconicApis = window._Iconic ? window._Iconic.smartIconApis : {};

iconicApis["box-plot"] = iconicApis["box-plot"] || function(t) {

    window.logging = true;

    $c().log("Staring box-plot ...");

    var f1 = function(orientation) {

        // normal
        // transposed

        t.setAttribute("box-plot-orientation", orientation);

        $c().log("Set box-plots direction to " + orientation);

        $c().log(orientation);

        if (orientation == "transposed") {
            $c(t).off(".iconic-box-plot-normal");
            $c(t).on(".iconic-box-plot-transposed");
        }
        else {
            $c(t).off(".iconic-box-plot-transposed");
            $c(t).on(".iconic-box-plot-normal");
        }
    };
    var f2 = function() {
        var a = t.getAttribute("data-box-plot-orientation");
        a && f1(a);
    };
    return {
        update: f2,
        setOrientation: f1
    }
};
//
